  {
    fullName: 'John Doe',
    userId: 'john.doe100',
    email: 'john@mail.com',
    accessType: 'updates'
  },
  {
    fullName: 'Jeanne Doe',
    userId: 'jeanne.doe200',
    email: 'jeanne@mail.com',
    accessType: 'updates'
  },
  {
    fullName: 'Bobby Doe',
    userId: 'bobby.doe300',
    email: 'bobby@mail.com',
    accessType: 'updates'
  }
];

class Users extends React.Component {
  componentDidMount() {
    // Get data from the db
    this.setState({ users: DATA });
  }
  render() {
    return (
      <div>
        <h1>Users</h1>
        {/* <UsersList props={this.state.users} /> */}
      </div>
    );
  }
}

export default Users;
